import React from 'react'
import Nav from './Navigation/Nav'
import {Route,Router} from 'react-router-dom';
import home from './Home/home';


const App=()=> {
  return (
    <>
   <Nav/>
   <Router>  
    <div>  
      <h1>React Router Example</h1>  

      <Route exact path="/" component={home} />  

    </div>  
  </Router>  
        </>
  );
}

export default App;
